import { Vector } from "./vector";

export class Particle {
  pos: Vector
  m: number
  r: number
  v: Vector
  a: Vector
  ctx: CanvasRenderingContext2D
  id: string
  added: boolean
  constructor(position: Vector, mass: number, a0: Vector, v0: Vector, ctx: CanvasRenderingContext2D, added: boolean = false, r: number = mass) {
    this.pos = position
    this.m = mass
    this.r = r
    this.a = a0
    this.v = v0

    this.ctx = ctx
    this.id = (Math.random() * 10**12).toString(16)
    this.added = added
  }

  applyVector(f: number[], dt: number) {
    const hor = {
      a: f[0]/this.m,
      v: (f[0]/this.m)*(dt/1000)
    }
    const ver = {
      a: f[1]/this.m,
      v: (f[1]/this.m)*(dt/1000)
    }

    const a = [hor.a, ver.a]
    const v = [hor.v, ver.v]
    
    this.a.add(a)
    this.v.add(v)
  }

  update(state: {particles: Particle[]}, dt: number) {
    state.particles.filter(x => x.id !== this.id).forEach(p => {
      const f1 = Particle.calcForce(this, p)
      this.applyVector(f1, dt)
      const f2 = Particle.calcForce(p, this)
      p.applyVector(f2, dt)
      // const _a = (this.pos.h - p.pos.h)/(this.pos.v-p.pos.v)
      
          
      if(this.pos.v === Infinity) this.pos.v = 0
      if(this.pos.h === Infinity) this.pos.h = 0
      
      // console.log(this.pos.dist(p.pos.array))
      if(this.pos.dist(p.pos.array) <= this.r/2 + p.r/2) {
        state.particles.push(new Particle(
          this.pos,
          (this.m + p.m)/1.5,
          this.a,
          this.v,
          this.ctx,
          false,
          (this.r + p.r) / 1.5
        ))
        
        state.particles = state.particles.filter(x => x.id !== this.id && x.id !== p.id)
        /*
        this.a.mult([-1, -1])
        this.v.mult([-1, -1])
        
        p.a.mult([-1, -1])
        p.v.mult([-1, -1])
        */
      }
      
      if(this.pos.v - this.r/2 < 0 || this.pos.v + this.r/2 > this.ctx.canvas.height) {
        this.a.mult([1, -1])
        this.v.mult([1, -1])
      }
      
      if(this.pos.h - this.r/2 < 0 || this.pos.h + this.r/2 > this.ctx.canvas.width) {
        this.a.mult([-1, 1])
        this.v.mult([-1, 1])
      }
    })
    this.v.add(this.a.array.map(x => x/(dt*1000)))
    this.pos.add(this.v.array.map(x => x*dt/1000))
    if(this.added) debugger

  }

  draw(ctx: CanvasRenderingContext2D) {

    ctx.beginPath()
    ctx.arc(this.pos.h, this.pos.v, this.r, 0, Math.PI*2)
    if(this.added) ctx.fillStyle = 'red'
    else ctx.fillStyle = 'white'
    ctx.fill()
    ctx.closePath()

  }


  /**
   * Returns an array of forces [horizonal, vertical] with which particles work on each other
   * @param p1 {Particle}
   * @param p2 {Particle}
   */
  static calcForce(p1: Particle, p2: Particle): number[] {
    function formula(M: number, m: number, r: number) {
      return G*M*m/(r**2)
    }
    const G = 6.67 * (10**-8) 
    return [
      -1*formula(p1.m, p2.m, p1.pos.h + p2.pos.h)*(p1.pos.h - p2.pos.h),
      -1*formula(p1.m, p2.m, p1.pos.v + p2.pos.v)*(p1.pos.v - p2.pos.v)
    ]
  }
}
